import React, {useState, useEffect} from 'react';
import axios from 'axios';

const User = () => {

  useEffect(() => {
    axios
      .get("/api/auth/products")
      .then((response) => {
        setProductsData(response.data);
        setFilterProductData(response.data);
        setLoading(false);
        console.log(response.data);
      })
      .catch((err) => {
        console.log(err);
        setLoading(true);
      });
  }, []);

  return (
    <div>
        <h1>User List</h1>
    </div>
  )
}

export default User
